import React from "react";

class chimForm extends React.Component{
    render(){
        return(
            <form method="post">
                <legend>Химические вещества</legend>
                <input placeholder="Температура"/>
                <legend>Состав в процентах</legend>
                <input placeholder="Метан"/>
                <input placeholder="Этан"/>
                <input placeholder="Пропан"/>
            </form>
        )}

}

export default chimForm
